import React, { useContext } from 'react';
import Login from './Components/Auth/Login';
import ListAccounts from './Components/Accounts/ListAccounts';
import AuthContext from './Store/auth-context';

function App() {
    return (
        <AuthContext.Provider>
            {ctx.email}
            <Login/>
            <ListAccounts/>
        </AuthContext.Provider>
    );
}

export default App;
